#!/usr/bin/env python3
"""Analyze QAOA emulator sweep results."""

import json

EDGES = [
    (0, 1), (0, 2), (1, 3), (1, 4), (2, 4), (2, 5),
    (3, 6), (4, 6), (4, 7), (5, 7), (6, 8), (7, 8),
]
PARTITION_A = {0, 3, 4, 5, 8}
MAX_CUT = 12


def bit_at(bs, q):
    return int(bs[-(q + 1)])


def cut_value(bs):
    return sum(1 for i, j in EDGES if bit_at(bs, i) != bit_at(bs, j))


def analyze(results, label):
    total = sum(results.values())
    exp_cost = sum(cut_value(bs) * c / total for bs, c in results.items())

    # Optimal bitstrings in QI convention (rightmost = q[0])
    # A={0,3,4,5,8} gets 1: q8q7q6q5q4q3q2q1q0 = 1,0,0,1,1,1,0,0,1 = 100111001
    # A={0,3,4,5,8} gets 0: = 011000110
    opt1 = "100111001"
    opt2 = "011000110"
    p_opt = (results.get(opt1, 0) + results.get(opt2, 0)) / total

    # Top 5 bitstrings
    top5 = sorted(results.items(), key=lambda x: -x[1])[:5]

    print(f"=== {label} ===")
    print(f"  Expected cost: {exp_cost:.2f} / {MAX_CUT} = {exp_cost/MAX_CUT:.3f} approx ratio")
    print(f"  P(optimal): {p_opt:.4f} ({results.get(opt1, 0)} + {results.get(opt2, 0)} shots)")
    print(f"  Top 5:")
    for bs, c in top5:
        cv = cut_value(bs)
        is_opt = " *** OPTIMAL" if bs in (opt1, opt2) else ""
        print(f"    {bs}: {c} ({c/total:.3f}) cut={cv}{is_opt}")
    print()


